/*Table structure for table `menus` */

DROP TABLE IF EXISTS `menus`;

CREATE TABLE `menus` (
  `SeqId` bigint(20) NOT NULL AUTO_INCREMENT,
  `MenuNo` varchar(20) NOT NULL DEFAULT '',
  `MenuName` varchar(30) NOT NULL DEFAULT '',
  `PMenuNo` varchar(20) NOT NULL DEFAULT '',
  `MenuId` varchar(100) NOT NULL DEFAULT '',
  `MenuUrl` text NOT NULL,
  `MenuHint` varchar(255) NOT NULL DEFAULT '',
  `MenuTarget` varchar(30) NOT NULL DEFAULT '',
  `FuncNo` varchar(60) NOT NULL DEFAULT '',
  `DisplayOrder` int(11) NOT NULL DEFAULT '1000',
  `InUse` smallint(6) NOT NULL DEFAULT '1',
  `AdminVisible` smallint(6) NOT NULL DEFAULT '1',
  `FolderUrl` varchar(255) NOT NULL DEFAULT '',
  `Expand` smallint(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`SeqId`),
  KEY `menus_idx1` (`MenuNo`),
  KEY `menus_idx2` (`FuncNo`)
) ENGINE=InnoDB AUTO_INCREMENT=365 DEFAULT CHARSET=utf8;

