/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `SeqId` bigint(20) NOT NULL AUTO_INCREMENT,
  `UserLogNo` varchar(30) NOT NULL,
  `UserPassword` varchar(50) NOT NULL,
  `SuperMan` smallint(6) NOT NULL DEFAULT '1',
  `CopartnerNo` varchar(20) NOT NULL DEFAULT '',
  `TrueName` varchar(10) NOT NULL DEFAULT '',
  `BindIp` varchar(100) NOT NULL DEFAULT '',
  `InUse` smallint(6) NOT NULL DEFAULT '1',
  `UserLoginType` varchar(2) NOT NULL DEFAULT '',
  `Tel` varchar(60) NOT NULL DEFAULT '',
  `QQ` varchar(20) NOT NULL DEFAULT '',
  `Email` varchar(30) NOT NULL DEFAULT '',
  `StartValiddate` varchar(10) NOT NULL DEFAULT '',
  `EndValiddate` varchar(10) NOT NULL DEFAULT '',
  `UpUserLogNo` varchar(30) NOT NULL DEFAULT '',
  `WorkingPlatform` text NOT NULL,
  `SingleLogin` smallint(6) NOT NULL DEFAULT '0',
  `EditBy` varchar(30) NOT NULL DEFAULT '',
  `EditTime` varchar(19) NOT NULL DEFAULT '',
  PRIMARY KEY (`SeqId`,`UserLogNo`),
  KEY `users_idx1` (`UserLogNo`),
  KEY `users_idx2` (`CopartnerNo`),
  KEY `users_idx3` (`InUse`)
) ENGINE=InnoDB AUTO_INCREMENT=711 DEFAULT CHARSET=utf8;

